import './App.css';
import landingPage from './pages/landing';
import {BrowserRouter as Router, Route} from "react-router-dom";


function App() {
  return (
    <div>
      <Router>
        <div>
            <Route exact path="/home" element={<landingPage/>} />
        </div>
      </Router>
    </div>
  );
}

export default App;
